import React, { Component } from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import AuthenticationService from "../../authentication/AuthenticationService"
import AssetDataService from "../../api/AssetDataService"

class AssetFormComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: this.props.match.params.id,
      name: '',
      date: '',
      initialValue: '',
      company: '',
      interest_rate: '',
      is_active: '',
      currentValue: '',
      is_variable_income: '',

    }
    this.onSubmit = this.onSubmit.bind(this);

  }

  componentDidMount() {
    if (this.state.id === "new") {
      return;
    }
  }

  onSubmit(values) {      
    console.log("Juca")   
    let username = AuthenticationService.getLoggedInUserName();  
    let asset = {
        name: values.name,
        date: values.date,
        initialValue: values.initialValue,
        company: values.company,
        interest_rate: values.interest_rate,
        is_active: values.is_active,
        currentValue: values.currentValue,
        is_variable_income: values.is_variable_income
    }

    if(this.state.id === "new") { 
      let token = AuthenticationService.getLoggedInToken();        
      AssetDataService.createAsset(username, asset, token)
            .then(() => this.props.history.push('/assets'));

    } else {                  
      // AssetDataService.updateAsset(username, this.state.id, asset)
      //       .then(() => this.props.history.push('/assets'));
    }
}

  onCancel() {
    window.history.back();
  }

  render() {
    let {name, date, initialValue, company, interest_rate, is_active, currentValue, is_variable_income} = this.state;

    return (
      <div className="text-center">
        <h1>Asset</h1>
        <div className="asset">
          <Formik
            initialValues={{name, date, initialValue, company, interest_rate, is_active, currentValue, is_variable_income}}
            onSubmit={this.onSubmit}
            validateOnChange={false}
            validateOnBlur={false}
            validate={this.validate}
            enableReinitialize={true}
          >
            {(props) => (
              <Form>
                <fieldset className="form-group">
                  <label>Name:</label>
                  <Field className="form-control" type="text" name="name" />
                </fieldset>
                <fieldset className="form-group">
                  <label>Date:</label>
                  <Field
                    className="fieldCategA"
                    type="date"
                    name="date"
                  />
                </fieldset>
                <fieldset className="form-group">
                  <label>Initial Value:</label>
                  <Field
                    className="fieldCategA"
                    type="text"
                    name="initialValue"
                  />
                </fieldset>
                <fieldset className="form-group">
                  <label>Interest Rate:</label>
                  <Field
                    className="fieldCategB"
                    type="text"
                    name="interestRate"
                  />
                </fieldset>
                <fieldset className="form-group">
                  <label>Is Active?</label>
                  <Field
                    className="checkbox"
                    type="checkbox"
                    name="isActive"
                  />
                </fieldset>
                <fieldset className="form-group">
                  <label>Is Variable Income?</label>
                  <Field
                    className="checkbox"
                    type="checkbox"
                    name="isVariableIncome"
                  />
                </fieldset>
                <fieldset className="form-group">
                  <label>Current Value:</label>
                  <Field
                    className="fieldCategA"
                    type="text"
                    name="currentValue"
                  />
                </fieldset>
                <fieldset className="form-group">
                  <label>Company:</label>
                  <Field className="form-control" type="text" name="company" />
                </fieldset>
                <button className="btn btn-success" type="submit">
                  Save
                </button>
                <button className="btn btn-warning" onClick={this.onCancel} type="button">
                  Cancel
                </button>
              </Form>
            )}
          </Formik>
        </div>
      </div>
    );
  }
}

export default AssetFormComponent;
